        var date = new Date();
        var year = date.getFullYear() - 3;
        var month = date.getMonth() + 1;
        var day = date.getDate();
        if (month < 10) {
            month = '0' + month;
        }
        if (day < 10) {
            day = '0' + day;
        }

        var today = year + '-' + month + '-' + day;
        this.chBirthDate = today;
